import React, { Component } from 'react';
class TinTuc extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: ""
    };
  }
  async componentDidMount() {
    const response = await fetch('server-spring-boot-api.herokuapp.com/api/CheckKey');
    if (response.ok) {
      const body = await response.text();
      alert(body);
    }

  }


  render() {

    return (
      <div>{this.state.items}</div>
    )
  }
}
export default TinTuc;
